script: |
  super -f text -I q3952.spq | sort > q3952.out

inputs:
  - name: q3952.spq
    data: |
      SELECT DISTINCT + + col2, 66 - col0 + col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN - col2 AND - 92 + + col0 + - + col0;
  - name: tab2

outputs:
  - name: q3952.out
    data: |
